import * as React from "react";
import { StyleProp, ViewStyle, Image, StyleSheet } from "react-native";
import { Border } from "../GlobalStyles";

const WhatsAppImage20230122At5Icon = ({ style }) => {
  return (
    <Image
      style={[styles.whatsappImage20230122At5Icon, style]}
      resizeMode="cover"
      source={require("../assets/whatsapp-image-20230122-at-524-1.png")}
    />
  );
};

const styles = StyleSheet.create({
  whatsappImage20230122At5Icon: {
    borderRadius: Border.br_81xl,
    width: 31,
    height: 31,
  },
});

export default WhatsAppImage20230122At5Icon;
